function Projects() {
    return (
        <>
            <h1>Projects:</h1>
            <p>github</p>

            <a href ="https://github.com/yusuf3a50/yusuf3a50.github.io/" target="_blank" rel="noopener noreferrer">here</a>

                I have more github repositories
                <a href="https://github.com/yusuf3a50/" target="_blank" rel="noopener noreferrer">here</a>
                and 
                <a href="https://github.com/sifr01/" target="_blank" rel="noopener noreferrer">here</a>.

            <p>codepen</p>
            I have a few more repos on my codepen profile 
            <a href="https://codepen.io/yusuf3a50/" target="_blank" rel="noopener noreferrer">here</a>
        </>
    );
}

export default Projects;
